import { GET_USER } from "../types";

export const getUser = () => (dispatch) => {
  dispatch({
    type: GET_USER,
    payload: {
      name: "djole",
      group: {
        name: "Admin",
        pages: ["cities", "positions", "projects", "users"],
      },
      loggedIn: true,
    },
  });
};
